import React from 'react';
import Form from './form.js'
import './App.css';

import Dice from './Dice.js'

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <Form />
      </header>
    </div>
  );
}

export default App;
